import Login from './Pages/Login';
import Route from './Components/Route';
import Register from './Pages/Register';


function App(){
   


    return (
      <div >
      <Route path="/">
      <Login/>
      </Route>
      <Route path="/register">
      <Register/>
        </Route>
  </div>);
}

export default App;
